import React from "react";
import "./style.css";

export default function Picture (props) {
    return (
        <div className="picture" onClick={() => props.handleOnClick(props.id)}>
            {/* <div className="img-container"> */}
            <img alt={props.name} src={props.image} />
            {/* </div> */}
        </div>
    )
}
